import React from 'react'
import styles from './ViewPedido.module.css'

//hooks
import {useParams} from 'react-router-dom'
import { useEffect } from 'react'

//redux
import { useDispatch, useSelector } from 'react-redux'
import { getPedidoById } from '../../slices/pedidoSlice'

//components
import CardPedido from '../../components/cardpedido/CardPedido'

const ViewPedido = () => {

  const {id} = useParams()
  const dispatch = useDispatch()
  const {pedido, message, error} = useSelector((state) => state.pedido)

  useEffect(() => {
    dispatch(getPedidoById(id))
  }, [dispatch, id])

  return (
    <div className={styles.container}>
      <div className={styles.tico}>
        <CardPedido
          className={styles.card}
          url={pedido.image}
          username={pedido.username}
          local={pedido.local}
          tipos={pedido.tipos}
          desc={pedido.desc}
        />
        <section>
          tico duro pra caralho
        </section>
      </div>
    </div>
  )
}

export default ViewPedido
